;; @@
; Single pendulum data set in small angle approximation.

(def theta0 0.15) ;rads
(def grav-acc 9.8) ;ms-1
(def length 7.5) ;m
(def domain-step 0.1)
(def theta (doall (map (fn [t] 
                         [t (* theta0 (Math/cos (* (Math/sqrt (/ grav-acc length)) t)))]) 
                       (range 0 15 domain-step))))
(def theta-dot (doall (map (fn [t]
                             [t (* -1 (Math/sqrt (/ grav-acc length)) theta0 (Math/sin (* (Math/sqrt (/ grav-acc length)) t)))])
                           (range 0 15 domain-step)))) 
(def theta-double-dot (doall (map (fn [t]
                                    [t (* -1 (/ grav-acc length) theta0 (Math/cos (* (Math/sqrt (/ grav-acc length)) t)))])
                                  (range 0 15 domain-step))))
