; check nth best works. Note that for first-deriv-pair (dtheta/dtheta-dot) it is necesary to divide functions (d-by-dtheta/d-by-dtheta-dot)

(compose

(list-plot (map #(list (last %) (first %)) first-deriv-pair))
(list-plot
 (let [d-by-dtheta (symbolic-derivative (:expr (nth sorted-pareto-front-individuals-1a 0)) 'theta)
      d-by-dtheta-dot (symbolic-derivative (:expr (nth sorted-pareto-front-individuals-1a 0)) 'theta-dot)
      partial-derivs-ratio (list 'pdiv d-by-dtheta-dot d-by-dtheta)
      f (functionalise-theta partial-derivs-ratio)
      ]
     (map #(list (last %) (f (nth % 1) (nth % 2))) first-deriv-pair)) :joined true)
 
 )
